import React from 'react'
import Connexion from '../Compenent/Inscriptions-Connexions/Connexion'
import {useSelector,useDispatch} from 'react-redux'
import ProviderCustom from '../customProvider'
import Router from 'next/router'

export default function Index() {
    const {connected} = useSelector(state=> ({...state.connexionReducer}))
    if(!connected)
    return (
        <div>
        <ProviderCustom>
            <Connexion/>
        </ProviderCustom>
        </div>
    )
    else{
        Router.replace("/private", "/login", { shallow: true });
    }
}
